import React from 'react'
import colorOptions from '../data/ColorOption'

const ColorsTheme = (props) => {
    return (
        <>
            <div className="color-swatches">
                {
                    colorOptions.map((colorVal, index) => {
                        <span key={index} className='colors' style={{ backgroundColor: colorVal }} onClick={props.changeColor}></span>
                    })
                }
                <span className='colors' style={{ backgroundColor: '#6610f2' }} onClick={props.changeColor}></span>
                <span className='colors' style={{ backgroundColor: '#ff5722' }} onClick={props.changeColor}></span>
                <span className='colors' style={{ backgroundColor: '#39953d' }} onClick={props.changeColor}></span>
                <span className='colors' style={{ backgroundColor: '#795548' }} onClick={props.changeColor}></span>
                <span className='colors' style={{ backgroundColor: '#2d5364' }} onClick={props.changeColor}></span>
            </div>
        </>
    )
}

export default ColorsTheme
